import React, { Component } from 'react'

class PostTable extends Component {
    render() {
        return(
            <table style={{width : '100vw'}}>
                <tr>
                <th>Post ID</th>
                <th>Text</th>
                <th>Clicks</th>
                <th>Impressions</th>
                <th>Currency</th>
        </tr>
        </table>
    )
  }
}

export default PostTable
